import React, { useState } from 'react';
import MenuBar from './components/menu/menuBar';
import VehicleList from './components/vehicle/vehicleList'; // Importa los datos del archivo

function Home() {
  return (
    <div className="App" style={{ display: 'flex', flexDirection: 'row' }}>
    <div style={{ flex: '1', minWidth: '40%' }}>
      <VehicleList />
    </div>
    <div style={{ flex: '1', minWidth: '60%' }}>
      <Mapa datosGeoJSON={datosGeoJSON} />

    </div>
  </div>
  );
}

function About() {
  return <h2>About</h2>;
}

function Contact() {
  return <h2>Contact</h2>;
}

function App() {
  const [route, setRoute] = useState('home');

  const renderComponent = () => {
    console.log('-------route-----',route)
    switch (route) {
      case 'about':
        return <About />;
      case 'contact':
        return <Contact />;
      default:
        return <Home />;
    }
  };

  return (
    <div>
      <MenuBar />
      <nav>
        <ul>
          <li onClick={() => setRoute('home')}>Home</li>
          <li onClick={() => setRoute('about')}>About</li>
          <li onClick={() => setRoute('contact')}>Contact</li>
        </ul>
      </nav>

      {renderComponent()}
    </div>
  );
}

export default App;
